import React, { useEffect, useState } from "react";

import Navbar from "../components/Navbar";
import AuthorsCard from "../components/AuthorsCard";

const Authors = () => {
  const [authors, setAuthors] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const dataAuthors = await fetch(
        `${process.env.REACT_APP_API_ENDPOINT}/authors`
      ).then((res) => res.json());

      setAuthors(dataAuthors);
    };
    fetchData();
  }, []);
  console.log(authors)
  return (
    <div>
      <Navbar />
      <div className="container" key="cards">
        <div className="row">
          {authors.map((author) => (
            <AuthorsCard author={author} key={author.id} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default Authors;
